export default
function greeting(name){
    const d = new Date()
    // alert(d.getHours())
    if(d >= 4 && d <= 11)
    alert(`morning ${name}`)
    else if(d >= 12 && d <= 16)
    alert(`afternoon ${name}`)
    else if(d >= 17 && d <= 19)
    alert(`evening ${name}`)

}
greeting('Leo')
